def find_3_highest_distinct_numbers(nums):
    count = {}
    for num in nums:
        count[num] = count.get(num, 0) - 1
    distinct_nums = list(count.keys())
    distinct_nums.sort(reverse=True)
    return distinct_nums[:3]

